import React from 'react';

const DEFAULT_STATE = {
    users: []
};

const Card = (props) => {
    const users = props.users;
    if (users.length)
        return users.map((user, i) => {
            return (
                <Card
                    user={user}
                    key={i}
                />
            )
        });
    else
        return null;
}

class UserMiniCard extends React.Component {

    state = {...DEFAULT_STATE};

    constructor(props) {
        super(props);
        this.state.users = this.props.users;
    }
    render() {
        const { users } = this.state;
        return(
            <Card users={users} />
        )
    }
}
export default UserMiniCard;
